function ({value}, {output1, output2, output3}, {state}) {
  const currentIndex = state.get("currentIndex") || 0;
  let nextIndex = currentIndex + 1;
  if (nextIndex > 2) {
    nextIndex = 0;
  }
  state.set("currentIndex", nextIndex);

  if (nextIndex === 0) {
    output1.next(value);
  } else if (nextIndex === 1) {
    output2.next(value);
  } else {
    output3.next(value);
  }
}
